import React from 'react';
import Card from './Card';

const CardList = ({ persons }) => {
	return (
		<div>
			{
				persons.map((value, i) => {
						return (<Card 
						key={i} 
						name={persons[i].name} 
						height={persons[i].height} 
						mass={persons[i].mass}
						/>
					);
				})
			}
		</div>
	);
}

export default CardList;

